import React from 'react';
import { useTranslation } from 'react-i18next';
import { trackPricingView } from '../../utils/analytics';

const PricingSection: React.FC = () => {
  const { t } = useTranslation();

  return (
    <section id="pricing" className="py-24 bg-white relative overflow-hidden">
      {/* Subtle background pattern */}
      <div className="absolute inset-0 opacity-[0.01]">
        <div className="absolute inset-0" style={{
          backgroundImage: 'radial-gradient(circle at 1px 1px, rgb(15 23 38) 1px, transparent 0)',
          backgroundSize: '28px 28px'
        }}></div>
      </div>

      <div className="max-w-6xl mx-auto px-6 relative">
        <div className="text-center mb-20">
          <h2 className="text-4xl md:text-5xl font-semibold text-slate-900 mb-6 leading-tight">
            {t('pricing.title')}
          </h2>
          {t('pricing.subtitle') && (
            <p className="text-lg text-slate-600 max-w-2xl mx-auto">
              {t('pricing.subtitle')}
            </p>
          )}
        </div>

        <div className="grid grid-cols-1 lg:grid-cols-3 gap-6">
          {t('pricing.plans', { returnObjects: true }).map((plan: any, index: number) => (
            <div key={index} className={`p-8 border rounded-lg bg-white ${plan.popular ? 'border-slate-900 border-2 shadow-lg' : 'border-slate-200 hover:border-slate-300'} transition-all`}>
              {plan.popular && (
                <div className="mb-4">
                  <span className="text-xs font-medium text-slate-900 bg-slate-100 px-2 py-1 rounded">
                    {t('pricing.mostPopular')}
                  </span>
                </div>
              )}

              <div className="mb-8">
                <h3 className="text-xl font-semibold text-slate-900 mb-4">{plan.name}</h3>
                <div className="mb-4">
                  <span className="text-4xl font-semibold text-slate-900">{plan.price}</span>
                  <span className="text-slate-600">/mo</span>
                </div>
                <p className="text-slate-600 mb-6">{plan.description}</p>
                <div className="p-4 bg-slate-50 rounded-lg border border-slate-200">
                  <p className="text-sm font-medium text-slate-900">{plan.for}</p>
                </div>
              </div>

              <ul className="space-y-3 mb-8">
                {plan.features.map((feature: string, featureIndex: number) => (
                  <li key={featureIndex} className="text-slate-600 text-sm">
                    {feature}
                  </li>
                ))}
              </ul>

              <a 
                href={plan.buttonLink || "#pricing"} 
                target={plan.buttonLink ? "_blank" : undefined}
                rel={plan.buttonLink ? "noopener noreferrer" : undefined}
                className={`w-full py-3 px-6 rounded-lg font-medium text-center block transition-colors ${
                  plan.popular 
                    ? 'bg-slate-900 text-white hover:bg-slate-800' 
                    : 'bg-white text-slate-900 border border-slate-200 hover:bg-slate-50'
                }`}
                onClick={() => trackPricingView(plan.name)}
              >
                {plan.button}
              </a>
            </div>
          ))}
        </div>

        {t('pricing.setupServices', { returnObjects: true }) && (
          <div className="mt-20">
            <div className="text-center mb-12">
              <h3 className="text-2xl font-semibold text-slate-900 mb-4">{t('pricing.setupServices.title')}</h3>
              <p className="text-slate-600 max-w-2xl mx-auto">{t('pricing.setupServices.subtitle')}</p>
            </div>

            <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-4 gap-6 max-w-5xl mx-auto">
              {t('pricing.setupServices.services', { returnObjects: true }).map((service: any, index: number) => (
                <div key={index} className="card p-6 text-center">
                  <h4 className="text-lg font-semibold text-slate-900 mb-2">{service.name}</h4>
                  <p className="text-2xl font-bold text-blue-600 mb-4">{service.price}</p>
                  <p className="text-sm text-slate-600">{service.description}</p>
                </div>
              ))}
            </div>
          </div>
        )}
      </div>
    </section>
  );
};

export default PricingSection;
